from typing import List, Optional

from leetcode.utils.list import ListNode, make_linked_list
from leetcode.utils.tree import TreeNode, make_binary_tree


# https://leetcode.com/problems/find-the-difference/
class Solution:
    def findTheDifference(self, s: str, t: str) -> str:
        """
        >>> solution = Solution()
        >>> solution.findTheDifference('a', 'ab')
        'b'
        >>> solution.findTheDifference('abc', 'bdca')
        'd'
        >>> solution.findTheDifference('a', 'aa')
        'a'
        >>> solution.findTheDifference('ahah', 'hhaab')
        'b'
        >>> solution.findTheDifference('ahah', 'hhaaa')
        'a'
        >>> s = ""
        >>> t = ""
        >>> solution.findTheDifference(s, t)
        't'
        """
        char_map = {}
        for char in s:
            if char not in char_map:
                char_map[char] = 0
            char_map[char] += 1
        for char in t:
            if char not in char_map:
                return char
            else:
                char_map[char] -= 1
            if char_map[char] == 0:
                del char_map[char]
